import { makeStyles } from '@material-ui/core'
import { SidePanelItem } from '../../Molecules/SidePanelItem/SidePanelItem'
import {viewMore,results} from '../../../Constants/constants'
import { SearchBar } from '../../Atoms/SearchBar/SearchBar'


export type templateListProps = {}

export const SidePanel = (props: templateListProps) => {
  const useStyles = makeStyles((theme) => ({
    Item: {},
  }))

  const classes = useStyles()
  return (
    <Grid
      container
      direction="column"
      spacing={1}
      style={{
        width: '',
        height: '',
      }}
    >
      <Grid item><SearchBar></SearchBar></Grid>
      <Grid item>
        <Grid container direction='row' spacing={3}>
            <Grid item>{results}</Grid>
            <Grid item>{viewMore}</Grid>
        </Grid>


      </Grid>
      <Grid item></Grid>


    </Grid>
  )
}
